import React from 'react';
import './Navbar.css'; // Importing the CSS file for Navbar
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <header className="header">
      <nav className="navbar">
      <section className='navbar__logo'>ProjectK</section>
        <ul className="nav-links">
          <li ><a href='/monitoring' className="nav-item">Monitoring</a></li>
          <li className="nav-item"><a href='/product'>Product</a></li>
          <li className="nav-item"><a href='/user'>User</a></li>
          <li className="nav-item"><a href='/service'>Service</a></li>

        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
